  return {
    type: "ADD_USER",
    payload: info,
  };
}

export function modificarDocente(info) {
  return {
    type: "MODIFY_USER",
    payload: info,
  };
}

export function borrarDocente(info) {
  return {
    type: "DELETE_USER",
    payload: info,
  };
}

